import s from './Post.module.css';

const Post = () => {
    return (
            <div>
                My posts
                <div> 
                    New post
                </div>
                <div>
                    <div className={s.item}>
                        post 1
                    </div>
                    <div className={s.item}>
                        post 2
                    </div>
                </div>
            </div>
    )
}

export default Post;
